import React from "react";
import { NavLink } from "react-router-dom";


function NotFound() {
  return (
    <div>
      <h2>Not Found</h2>
      <p>Click <NavLink to="/">here</NavLink> to go back to home page</p>
    </div>
  );
}

export default NotFound;
